import React from 'react'
import styled from 'styled-components'
import SearchBar from './components/search/SearchBar'

const Container = styled.div`
  background: linear-gradient(rgba(111,105,105,1), rgba(76,75,75,0.5));
  width: 808px;
  height: 478px;
  display:flex ;
  margin:auto;
  border-radius: 30px ;
`
const Wrapper = styled.div`
  display:flex ;
  margin:auto ;
`

const App = () => {
  return (   
    <Container>
      <SearchBar />
      <Wrapper>
      </Wrapper>
    </Container>
  )
}

export default App
